CREATE TABLE IF NOT EXISTS `tgate` (
  `tg_idx` int(11) NOT NULL AUTO_INCREMENT,
  `tg_url` varchar(200) NOT NULL,
  `cust_id` varchar(30) DEFAULT NULL,
  `model` varchar(50) DEFAULT NULL,
  `tff_id` varchar(15) DEFAULT NULL COMMENT 'lte69',
  `tff_idx` int(11) NOT NULL,
  `join_type` varchar(20) DEFAULT NULL,
  `rgst_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `tariff` varchar(30) DEFAULT NULL,
  `total_price` int(11) DEFAULT NULL,
  PRIMARY KEY (`tg_idx`),
  UNIQUE KEY `tg_url` (`tg_url`),
  KEY `setfk_join_type` (`join_type`),
  KEY `setfk_cust` (`cust_id`),
  KEY `setfk_tariff` (`tff_id`),
  KEY `setfk_model_tg` (`model`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=659 ;

