select 
          tg.tg_idx,
          cs.customer,
          mb.mobile,
          ctr.join_type,
          ctr.join_fee,
          ctr.usim,
          ctr.i_price,
          ctr.i_month,
          tff.tff_month,
          tff.tariff,
          ctr.ctr_url
          
          
          from 
               tgate tg, 
               customer cs,
               mobile mb,
               contract ctr,
               tariff tff 
          where tg.tg_idx = mb.tg_idx
          and tg.tg_idx = cs.tg_idx
          and tg.tg_idx = ctr.tg_idx
          and tg.tg_idx = tff.tg_idx
          
          
          
          order by tg_idx desc;
